import React from "react";

function Graph () {
  helpText = "Help text!";

  return(

      <div className="left">
        <Header x="Шапка сайта&!" />
        <h1>{this.helpText}</h1>
        <input
          placeholder={this.helpText}
          onClick={this.inputClick}
          onMouseEnter={this.mouseOver}
        />
        <p>{this.helpText === "Help text!" ? "Yes" : "No"}</p>
      </div>
    );
  

}

export default Graph;
